class ProjectAddCommentRequestModel {  int? manageProjectId;  String? message;  String? path;  ProjectAddCommentRequestModel(      {this.manageProjectId, this.message, this.path});  ProjectAddCommentRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    message = json['message'];    path = json['path'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['message'] = this.message;    data['path'] = this.path;    return data;  }}